import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { Button, StyleSheet, Text, View } from 'react-native';

export default function App() {
  return (
    <View style={styles.container}>
      <Text>Open up up App.js to start working on your app!</Text>
      <View style={styles.container}>
        <Button>1</Button>
        <Button>2</Button>
        <Button>3</Button>
      </View>
      <View>
        <Button style={styles.tlacidlo}><Text style={styles.tlacidlo}>4</Text></Button>
        <Button>5</Button>
        <Button>6</Button>
      </View>
      <View>
        <Button>7</Button>
        <Button>8</Button>
        <Button>9</Button>
      </View>
      <View>
        <Button>#</Button>
        <Button>0</Button>
        <Button>*</Button>
      </View>
      <StatusBar style="auto" />
    </View>
    );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#ffffff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  background: {
    backgroundColor: '#ff0000',

  },
  tlacidlo: {
    alignItems: 'center',
    backgroundColor: '#ffffff',
    color: '#000000'
  },
});
